var title_f22_22_22880="Screen Wilson sibling child";
var content_f22_22_22880=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=GAST%2F69940&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=GAST%2F69940&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 537px\">",
"   <div class=\"ttl\">",
"    Screening for Wilson disease (WD) in sibling or child of a patient with secure diagnosis of WD",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 517px; height: 540px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    If molecular testing is available in the index patient, then this is the most efficient screening strategy. If initial screening by blood and urine testing is normal, then consider repeat screening in 2 to 5 years.",
"    <br>",
"     Conversion to SI units: CPN &lt;20 mg/dL or 0.2 g/L; 24-hour urinary Cu &gt;40 micrograms/day or 0.6 micromol/day.",
"     <br>",
"      Baseline testing = complete blood count including platelet count (CBC), liver biochemistries, international normalized ratio (INR), serum ceruloplasmin, 24-hour urine copper excretion; liver biopsy when appropriate.",
"      <div class=\"footnotes\">",
"       KF: Kayser-Fleischer.",
"      </div>",
"      <div class=\"reference\">",
"       Roberts EA, Schilsky ML. Diagnosis and treatment of Wilson disease: an update. Hepatology 2008; 47:2089.",
"      </div>",
"     </br>",
"    </br>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
