var title_f22_22_22885="Inflamed gouty tophi";
var content_f22_22_22885=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=SURG%2F74050&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=SURG%2F74050&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 568px\">",
"   <div class=\"ttl\">",
"    Inflamed gouty tophi",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 548px; height: 410px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Gout is a disorder of urate metabolism that leads to high levels of uric acid and the formation of urate crystals. Urate crystals can be deposited under the skin, in joints and within tendon sheaths as gouty tophi, which can cause an intense inflammatory process. Panel A demonstrates the clinical appearance of gouty tophi. Panel B illustrates the radiographic appearance of gouty tophi. Note the multiple juxta-articular, punched-out lytic erosions (red circles) and a lack of osteoporosis, which is characteristic of gout.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
