"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Potential historical findings in children with acute kidney injury",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        History of fluid loss",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <ul>",
"         <li>",
"          Diarrhea, vomiting",
"         </li>",
"         <li>",
"          Burns",
"         </li>",
"         <li>",
"          Surgery",
"         </li>",
"         <li>",
"          Shock",
"         </li>",
"        </ul>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Exposure to nephrotoxic agents",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <ul>",
"         <li>",
"          Nonsteroidal antiinflammatory drugs",
"         </li>",
"         <li>",
"          Aminoglycosides",
"         </li>",
"         <li>",
"          Contrast agents",
"         </li>",
"        </ul>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Factors associated with glomerular diseases",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <ul>",
"         <li>",
"          Streptococcal infection: Post-streptococcal glomerulonephritis",
"         </li>",
"         <li>",
"          Bloody diarrhea: Hemolytic-uremic syndrome",
"         </li>",
"         <li>",
"          Joint symptoms, rash, or purpura: Henoch-Sch&ouml;nlein purpura",
"         </li>",
"        </ul>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Signs of obstruction",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <ul>",
"         <li>",
"          Complete anuria",
"         </li>",
"         <li>",
"          Poor urinary stream",
"         </li>",
"        </ul>",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
