var title_f22_22_22892="Pros and cons of spiral CT";
var content_f22_22_22892=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PULM%2F81416&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PULM%2F81416&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Advantages and limitations of spiral computed tomography scanning for the diagnosis of pulmonary embolism",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\" class=\"container\">",
"     <tbody>",
"      <tr>",
"       <td class=\"container\">",
"        <table cellspacing=\"0\">",
"         <tbody>",
"          <tr>",
"           <td class=\"subtitle1_single\">",
"            Advantages*",
"           </td>",
"          </tr>",
"          <tr>",
"           <td>",
"            Specificity&bull;",
"           </td>",
"          </tr>",
"          <tr>",
"           <td>",
"            Availability",
"           </td>",
"          </tr>",
"          <tr>",
"           <td>",
"            Safety",
"           </td>",
"          </tr>",
"          <tr>",
"           <td>",
"            Relative rapidity of procedure",
"           </td>",
"          </tr>",
"          <tr>",
"           <td>",
"            Diagnosis of other disease entities",
"           </td>",
"          </tr>",
"          <tr>",
"           <td>",
"            Retrospective reconstructions",
"           </td>",
"          </tr>",
"          <tr>",
"           <td>",
"            Advancing technology",
"           </td>",
"          </tr>",
"         </tbody>",
"        </table>",
"       </td>",
"       <td class=\"container\">",
"        <table cellspacing=\"0\">",
"         <tbody>",
"          <tr>",
"           <td class=\"subtitle1_single\">",
"            Limitations",
"           </td>",
"          </tr>",
"          <tr>",
"           <td>",
"            Reader expertise required",
"           </td>",
"          </tr>",
"          <tr>",
"           <td>",
"            Expense&Delta;",
"           </td>",
"          </tr>",
"          <tr>",
"           <td>",
"            Not portable",
"           </td>",
"          </tr>",
"          <tr>",
"           <td>",
"            Need contrast bolus comparable to angiogram",
"           </td>",
"          </tr>",
"          <tr>",
"           <td>",
"            Poor visualization of certain regions&loz;",
"           </td>",
"          </tr>",
"          <tr>",
"           <td class=\"sublist1_start\">",
"            Contraindications",
"           </td>",
"          </tr>",
"          <tr>",
"           <td class=\"sublist1\">",
"            Renal insufficiency",
"           </td>",
"          </tr>",
"          <tr>",
"           <td class=\"sublist1\">",
"            Contrast allergy",
"           </td>",
"          </tr>",
"         </tbody>",
"        </table>",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     * In clinical trials to date, high sensitivity and specificity have been limited to emboli in the main, lobar, and segmental vessels.",
"     <br>",
"      &bull; High specificity requires reader expertise.",
"      <br>",
"       &Delta; A number of issues impact on cost effectiveness, including the need for subsequent studies after a nondiagnostic initial study (e.g., V/Q scan) and the potential cost savings in patients with alternative diagnoses detected at CT scan.",
"       <br>",
"        &loz; The sensitivity is inadequate for subsegmental emboli. The ability to diagnose subsegmental emboli is also limited with pulmonary arteriography. Horizontal vessels in the right middle lobe and lingula, and the peripheral lung, may be poorly visualized. Lymph nodes may result in false-positive studies.",
"       </br>",
"      </br>",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
